        private void bgWork_ProgressChanged(
            object sender,
            ProgressChangedEventArgs e)
        {
            if (e.UserState != null && servManager != null)
            {
                string[] info = (string[])e.UserState;
                if (info == null || info.Length < 9)
                    return;
                servManager.Add(info[7], Convert.ToInt32(info[8]), Convert.ToInt32(info[0]), info[3], info[1]+" / "+info[2], info[4], info[5], Convert.ToInt16(info[6]));
                label1.Text = "Server: " + serverListGrid.Rows.Count;
            }
        }
        private void bgWork_DoWork(object sender, DoWorkEventArgs e)
        {
            BackgroundWorker worker = sender as BackgroundWorker;
            Query.Query sQuery = new Query.Query();
            System.Threading.Thread.Sleep(80);
            for (int l = 0; l < queueList.Count; l++)
            {
                if ((worker.CancellationPending == true))
                {
                    e.Cancel = true;
                    break;
                }
                string ip = queueList[l];
                // Query
                string[] serverI;
                serverI = ip.Split(':');
                if (serverI.Count() > 1)
                {
                    sQuery.setIp(serverI[0], Convert.ToInt32(serverI[1]));
                    if (sQuery.Send('i'))
                    {
                        int count = sQuery.Recieve();

                        string[] info = sQuery.Store(count);
                        if (info != null && count > 3)
                        {
                            bgWork.ReportProgress(0, info);
                            sQuery.Send('p');
                            queueList.RemoveAt(l);
                        }
                    }
                }
             }
        }
        private void bgWork_RunWorkerCompleted(object sender, RunWorkerCompletedEventArgs e)
        {
            if (e.Error != null)
                MessageBox.Show("Error: " + e.Error.Message);
            else if (e.Cancelled)
                //MessageBox.Show("Stopped!");
                serverListGrid.Update();
            else
                serverListGrid.Update();
        }

