        private void serverListGrid_CellClick(object sender, DataGridViewCellEventArgs e)
        {
            ruleManager.Clear();
            string[] address = serverListGrid.Rows[e.RowIndex].Cells[0].Value.ToString().Split(':');
            MessageBox.Show("Host: " + address[0] +":"+ address[1]);
            Query.Query sQuery = new Query.Query();
            sQuery.setIp(address[0], Convert.ToInt32(address[1]));
            if (sQuery.Send('r'))
            {
                int count = sQuery.Recieve();
                string[] info = sQuery.Store(count);

                for (int l = 0; l < info.Length; l++)
                {
                    ruleManager.Add(info[l], info[++l]);
                }
            }
        }

